function getUrlPic(picture) { return "url("+host+picture+")"; }
function getCoveredPic(picture, customFunction) {
    return ["CB.png",
            function() {
                if ($(this).attr("dontClick") != undefined) return;
                if (typeof customFunction == "function") customFunction.call(this);
                $(this).css({background: getUrlPic(picture), "background-size": "cover", display: "block"});
            }
           ];
}
